import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Nav() {
  return (
    <> 
      <h3>HoHey</h3>
      <div class="topnav">
        <Link to="/">
          <li>Home</li>
        </Link>
        <Link to="/upload">
          <li>Upload Video</li>
        </Link>
     </div>
    </>
  );
}

export default Nav;
